import styled from "styled-components";
import Fundo3 from '../../components/img/fundo3.jpeg'

export const Fundo = styled.div`
  background: url(${Fundo3}) no-repeat center;
  width: 100%;
	height: 100vh;
	background-size: cover;
	text-align: center;
	padding: 5% 0;
  overflow-x: hidden;
`
export const Container = styled.div`
	margin: 5% 0;
`
